import { Entry } from '../types';

const Diagnoses = ({ entry }: { entry: Entry }) => {
  const style = {
    margin: 1,
    border: '1px solid black',
    borderRadius: '5px',
  };
  return (
    <div style={style}>
      {entry.date} <br />
      {entry.description} <br />
      {entry.specialist}
    </div>
  );
};

export default Diagnoses;
